    <div className="App">
      <Form />


      <div className='main'>
        <nav className='shadow-lg pb-3 mb-5 bg-body rounded'>
          <a href='/'>Главнвя</a>
        </nav>

        <div className='table'>

        </div>
      </div>
    </div>
  );
}

export default App;
